import React from "react";
// import {link, Outlet} from "react-router-dom";
import './header.style.css'
const Header  = () => {
    return(
    <header className="header">
        <ul className="nav-bar">
            <img src="" alt="monster" className="logo"/>
            <li className="nav-bar__item">
                <link to="/" className="nav-bar__link">صفحه اصلی</link>
            </li>
            <li className="nav-bar__item">
                <link to="./img/monster.png" className="nav-bar__link">هیولاها</link>
            </li>
            <li className="nav-bar__item">
                <link to="/" className="nav-bar__link">هیولاهای محبوب</link>
            </li>
            <li className="nav-bar__item">
                <link to="/" className="nav-bar__link">بلاگ</link>
            </li>
        </ul>
    </header>
    )
};
export default Header;
